import React from 'react';
import { ITablistProps } from '../types/types';

const Tablist = (props: ITablistProps): JSX.Element => {

    // const [map, setMap] = useState<BasemapState>(null)
    // const [activeButton] = useState(undefined)

    return (
        <>
           <div className="sidebar-tabs">
            <ul role="tablist">
                <li><a href="#home" role="tab"><i class="fa fa-bars"></i></a></li>
                <li><a href="#profile" role="tab"><i class="fa fa-user"></i></a></li>
                <li className="disabled"><a href="#messages" role="tab"><i class="fa fa-envelope"></i></a></li>
                <li><a href="https://github.com/Turbo87/sidebar-v2" role="tab" target="_blank"><i class="fa fa-github"></i></a></li>
            </ul>

            <ul role="tablist">
                <li><a href="#settings" role="tab"><i class="fa fa-gear"></i></a></li>
            </ul>
        </div>
        </>
    )
}

export default Tablist;
